import React from 'react';
import './Scroll.css';
import { Animator, batch, Fade, ScrollContainer, ScrollPage, ZoomOut } from 'react-scroll-motion';
import page1 from '../img/paper1.jpeg';

const Scroll= () => {
    return ( 
      <ScrollContainer>
        <ScrollPage page={0}> 
        <Animator animation={batch(Fade(),ZoomOut)}>

            <img src={page1}  alt="scrollimage1" />

        </Animator>
        </ScrollPage>
      </ScrollContainer>
     );
}

export default Scroll;
